#include "com_file.h"
#include "com_base64.h"
#include "com_log.h"
#include "comex_magic.h"
#include "comex_archive.h"
#include <magic.h>

#define MAGIC_CONTENT ""

FileMagic& GetFileMagicService()
{
    static FileMagic magic;
    return magic;
}

FileMagic::FileMagic()
{
    ctx = magic_open(MAGIC_MIME_TYPE | MAGIC_ERROR);
    if(ctx == NULL)
    {
        LOG_E("failed to open libmagic");
    }

    CPPBytes magic_xz = com_hexstring_to_bytes(MAGIC_CONTENT);
    ArchiveReader r(magic_xz.getData(), magic_xz.getDataSize());
    content = r.read("magic.mgc");
    r.close();
    if(content.empty() == false)
    {
        void* p = content.getData();
        size_t size = content.getDataSize();
        magic_load_buffers((magic_t)ctx, &p, &size, 1);
    }
    else
    {
        LOG_E("failed to load magic config form inline raw data");
    }
}


FileMagic::~FileMagic()
{
    if(ctx != NULL)
    {
        magic_close((magic_t)ctx);
        ctx = NULL;
    }
}

std::string FileMagic::getFileType(const char* file)
{
    if(file == NULL)
    {
        LOG_E("arg incorrect");
        return std::string();
    }
    const char* result = magic_file((magic_t)ctx, file);
    if(result == NULL)
    {
        LOG_E("failed to get file type:%s", file);
        return std::string();
    }
    return result;
}

std::string FileMagic::getContentType(const void* data, int data_size)
{
    if(data == NULL || data_size <= 0)
    {
        LOG_E("arg incorrect");
        return std::string();
    }
    const char* result = magic_buffer((magic_t)ctx, data, data_size);
    if(result == NULL)
    {
        LOG_E("failed to get content type");
        return std::string();
    }
    return result;
}

std::string FileMagic::getContentType(const CPPBytes& data)
{
    return getContentType(data.getData(), data.getDataSize());
}

